DPR:
Collect a comprehensive, year‑level dataset of Teekay LNG operating results (including at least 2018 and 2019) that contains:  
1) detailed financial line items for the group and for each segment (Teekay LNG, Teekay Tankers, Teekay Parent and the consolidated entity after inter‑company eliminations) – revenues, voyage expenses, vessel operating expenses, time‑charter hire expense, depreciation & amortization, general & administrative expenses, write‑downs/sales of vessels, restructuring charges, and income from vessel operations;  
2) vessel‑operation metrics – calendar‑ship‑days, off‑hire days, total TCE days, TCE rate per day, and total days for vessel operating expenses – together with clear definitions of each metric;  
3) the ability to compute year‑over‑year changes, identify years where segment revenues fall below 600,000 k USD, and calculate average, net and per‑day voyage revenues.  

The dataset should be structured to support queries that compare financial performance across years and segments, assess the impact of operational metrics on profitability, and provide the necessary metadata for interpreting all columns.
